import {
    GET_PAGES_REQUEST,GET_PAGES_FAIL,GET_PAGES_SUCCESS,
} from "./actionTypes";
import {saveSession} from "../../utility/session";


const INIT_STATE = {
    data:[],
    loading: false,
    success: false,
    fail: false,
    errors: {}
};

export default (state = INIT_STATE, action) => {
    switch (action.type) {
        case GET_PAGES_REQUEST:
            return {
                ...state,
                loading: true,
                success: false,
                fail: false,
                errors: {},
            };
        case GET_PAGES_FAIL:
