            //                 {name: 'add'},
            //                 {name: 'edit'},
            //                 {name: 'delete'}
            //             ],
            //         },
            // }

            return {
                ...state,
                loading: false,
                success: true,
                fail: false,
                // data: data1,
                errors: {},
            };
            //}
            return {
                ...state,
                loading: false,
                success: false,
                fail: true,
            };
        case GET_PAGES_SUCCESS:
            console.log(action.result.data)
            return {
                ...state,
                loading: false,
                success: true,
                fail: false,
                data: JSON.parse(action.result.data),
                errors: {},
            };

        default:
            return {...state};
    }
};
